        private void CrearMenusRoles(AwIngenieriaSoftware.Models.ApplicationDbContext context)
        {
            
            if (context.MenuRol.ToList().Count <= 0)
            {
                var RoleManager = new RoleManager<IdentityRole>(new RoleStore<IdentityRole>(context));
                var rolAdministrador = RoleManager.FindByName("Administrador");
                var rolEmpleado = RoleManager.FindByName("Empleado");
                var rolUsuario = RoleManager.FindByName("Usuario");
                var menus = context.Menu.ToList();
                foreach (var item in menus)
                {
                    MenuRol menuRol = new MenuRol() { Menu = item, Rol = rolAdministrador };
                    context.MenuRol.Add(menuRol);
                    context.SaveChanges();
                }

                foreach (var item in menus.Where(x => (x.Nombre.Equals("Módulos") || x.Nombre.Equals("Inicio")) && x.MenuPadre == null))
                {
                    MenuRol menuRol = new MenuRol() { Menu = item, Rol = rolEmpleado };
                    context.MenuRol.Add(menuRol);
                    context.SaveChanges();
                    foreach (var item2 in menus.Where(x => x.MenuPadre != null && x.MenuPadre.Id == item.Id))
                    {
                        MenuRol menuRol2 = new MenuRol() { Menu = item2, Rol = rolEmpleado };
                        context.MenuRol.Add(menuRol2);
                        context.SaveChanges();
                    }
                }


                foreach (var item in menus.Where(x => (x.Nombre.Equals("Inicio")) && x.MenuPadre == null))
                {
                    MenuRol menuRol = new MenuRol() { Menu = item, Rol = rolUsuario };
                    context.MenuRol.Add(menuRol);
                    context.SaveChanges();
                    foreach (var item2 in menus.Where(x => x.MenuPadre != null && x.MenuPadre.Id == item.Id))
                    {
                        MenuRol menuRol2 = new MenuRol() { Menu = item2, Rol = rolUsuario };
                        context.MenuRol.Add(menuRol2);
                        context.SaveChanges();
                    }
                }
            }
        }

